<H2 align=center>Mothers Day Mugs!</H2>
<P align=center><FONT size=4>HOW TO ORDER</FONT></P>
<P align=center><FONT size=2 face=Verdana>1. CHOOSE DESIGN BY HITTING ADD TO ORDER</FONT></P>
<P align=center><FONT size=2 face=Verdana>2. INSIDE TYPE WORDING ON FRONT WHERE NAME IS INDICATED</FONT></P>
<P align=center><FONT size=2 face=Verdana>3. MESSAGE ON BACK - YOUR OWN WORDS EXACTLY AS YOU WANT PRINTED.</FONT></P>
<P align=center><FONT size=2 face=Verdana>4. WHITE MUGS ONLY IN STOCK</FONT></P>
<P align=center><FONT size=2 face=Verdana>5. CHOOSE CERAMIC OR MELAMINE (GREAT FOR OUTDOOR TYPE MUM, AS UNBREAKABLE)</FONT></P>
<P align=center>GO AHEAD AND CHOOSE YOUR DESIGN</P>
<P align=center><FONT size=4><EM>(Does not automatically come with "Super Mum" etc. You have to type this in yourself in the "NAME:" section</EM></FONT></P>
